import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';

function Login({show,handleClose})
{
    return (
        <>
            <Modal show={show} onHide={handleClose}>
                <Modal.Header closeButton>
                </Modal.Header>
                <Modal.Body>
                    <div class="modal-left" id="modal-bg-container" style={{ backgroundImage:'https://cdn.zoutons.com/images/common/login_bg.png',backgroundColor:'013d62' }} > <h3>Why Sign up?</h3> <ul> <li>Exclusive deals</li> <li>More Savings</li> <li>Over 50 Stores</li> <li>Over 100 Categories</li> </ul> </div>
                </Modal.Body>
            </Modal>
        </>
      );
}





export default Login;
